import re
def parse_nested_parens(paren_string: str) -> List[int]:
    groups = re.findall(r'\([^()]*\)', paren_string)
    nesting_levels = []
    for group in groups:
        level = 0
        current_level = 0
        for char in group:
            if char == '(':
                current_level += 1
                if current_level > level:
                    level = current_level
            elif char == ')':
                current_level -= 1
        nesting_levels.append(level)
    return nesting_levels

